import { render } from '@testing-library/react';
import React from 'react'

const numbers = ['Medicine 1', 'Medicine 2', 'Medicine 3', 'Medicine 4', 'Medicine 5'];
const listItems = numbers.map((number) =>
  <form className = 'box' >{number}</form>
);

const mystyle = {
    position: 'absolute',
    width: "400px",
    height: '250px',
    top: '200px',

    background: '#FFFFFF',
    border: '1px solid #000000',
    radius: '25px'
};

const PrescriptionTabs = () => {

    return (
        <div>
            <ul style = {mystyle}>
                {listItems}
            </ul>
        </div>
      )
}

export default PrescriptionTabs
